    false,nt"url": null,nt"notes": "The purpose of this Master Plan is to give
    overall guidance for the protection, use, and development of Chincoteague National
    Wildlife Refuge during the next ten to twenty years. By describing activities needed
    to attain long-range management goals, this Master Plan establishes a comprehensive
    framework for refuge management that will: ensure consistency with national and
    regional Fish and Wildlife Service policy and direction; facilitate a timely response
    to current and anticipated threats to the refuge environment; provide continuity
    in refuge management; guide inventory and research efforts; and substantiate funding
